CREATE TEMP FUNCTION
  udf_aggregate_map_sum(maps ANY TYPE) AS (STRUCT(ARRAY(
      SELECT
        AS STRUCT key,
        SUM(value) AS value
      FROM
        UNNEST(maps),
        UNNEST(key_value)
      GROUP BY
        key) AS key_value));
--
CREATE TEMP FUNCTION
  udf_aggregate_keyed_map_sum(maps ANY TYPE) AS (STRUCT(ARRAY(
      SELECT
        AS STRUCT key,
        udf_aggregate_map_sum(ARRAY_AGG(value)) AS value
      FROM
        UNNEST(maps),
        UNNEST(key_value)
      GROUP BY
key) AS key_value));

WITH
    -- normalize client_id and rank by document_id
    numbered_duplicates AS (
        SELECT
            ROW_NUMBER() OVER (
                PARTITION BY
                    client_id,
                    submission_date,
                    document_id
                ORDER BY `timestamp`
                ASC
            ) AS _n,
            * REPLACE(LOWER(client_id) AS client_id)
        FROM main_summary_v4
        WHERE submission_date = @submission_date
        AND channel in (
            "release", "esr", "beta", "aurora", "default", "nightly"
        )
        AND client_id IS NOT NULL
    ),


    -- Deduplicating on document_id is necessary to get valid SUM values.
    deduplicated AS (
        SELECT * EXCEPT (_n)
        FROM numbered_duplicates
        WHERE _n = 1
    ),



    -- Aggregate by client_id using windows
    windowed AS (
        SELECT
            ROW_NUMBER() OVER w1_unframed AS _n,
            submission_date,
            client_id,
            os,
            SPLIT(app_version, '.')[OFFSET(0)] AS app_version,
            app_build_id,
            channel,

    ARRAY<STRUCT<
        metric STRING,
        metric_type STRING,
        key STRING,
        agg_type STRING,
        value FLOAT64
    >> [
        ('scalar_parent_devtools_inspector_node_selection_count', 'scalar', '', 'max', max(CAST(scalar_parent_devtools_inspector_node_selection_count AS INT64)) OVER w1),
