    FROM deduplicated
    WINDOW
        -- Aggregations require a framed window
        w1 AS (
            PARTITION BY
                client_id,
                submission_date,
                os,
                app_version,
                app_build_id,
                channel

            ORDER BY `timestamp` ASC ROWS BETWEEN UNBOUNDED PRECEDING
            AND UNBOUNDED FOLLOWING
        ),

        -- ROW_NUMBER does not work on a framed window
        w1_unframed AS (
            PARTITION BY
                client_id,
                submission_date,
                os,
                app_version,
                app_build_id,
                channel

            ORDER BY `timestamp` ASC
        )
    )

SELECT
    * EXCEPT(_n)
FROM
    windowed
WHERE
    _n = 1
